pragma solidity ^0.8.0;

import { LibDiamond } from "../libraries/LibDiamond.sol";
import { LibCurrency } from "../libraries/LibCurrency.sol";
import { LibSaleOrder } from "../libraries/LibSaleOrder.sol";
import { LibItem } from "../libraries/LibItem.sol";
import "../utils/math/SafeMath.sol";
import "../interfaces/ISellerFacet.sol";
import "../interfaces/IERC1155.sol";

contract MarketInfoFacet {

    function getUserOrders(address _user) external view returns(LibDiamond.SaleOrder[] memory saleOrders_) {
        return LibSaleOrder._getUserOrders(_user);
    }

    function getOrderItems(uint256 _orderId) external view returns (LibDiamond.SaleItem[] memory saleItems_) {
        return LibItem._getItemByOrderId(_orderId);
    }

    function getOrderById(uint256 _orderId) public view returns(LibDiamond.SaleOrder memory){
        return LibSaleOrder._getOrder(_orderId);
    }

    function getOrderIdByCode(bytes32 _code) public view returns(uint256){
        return LibSaleOrder._getOrderIdByCode(_code);
    }

    function getOrderLength() external view returns(uint256){
        return LibSaleOrder._getOrderCount();
    }

    function getItemByCode(bytes32 _code) external view returns(LibDiamond.SaleItem memory){
        return LibItem._getItemByCode(_code);
    }

    function _getItemIdByCode(bytes32 _code) external view returns(uint256){
        return LibItem._getItemIdByCode(_code);
    }

    function getItemLength() external view returns(uint256){
        return LibItem._getItemCount();
    }

    function orderIsReadyForSellByCode(bytes32 _orderCode) external returns(bool){
        uint256 _orderId = getOrderIdByCode(_orderCode);
        return orderIsReadyForSell(_orderId);
    }

    function orderIsReadyForSell(uint256 _orderId) public returns(bool){
        LibDiamond.SaleOrder memory _order = getOrderById(_orderId);
        if(_order.status != LibDiamond.OrderStatus.OnSell){
            return false;
        }
        if(block.timestamp > _order.sellPeriod){
            return false;
        }
        for(uint256 _itemId = 0 ; _itemId < _order.itemCount ; _itemId++){
            LibDiamond.SaleItem memory _item = LibItem._getItem(_itemId);
            if(IERC1155(_item.tokenContract).balanceOf(_order.owner, _item.tokenId) < _item.amount){
                return false;
            }
        }
        return true;
    }

    function getUserOrderOnSell (address _user) public view returns(LibDiamond.SaleOrder[] memory ordersReturn_){
        uint256[] memory _orderIds = getUserOrderIdOnSell(_user);
        ordersReturn_ = new LibDiamond.SaleOrder[](_orderIds.length);
        for(uint256 _index = 0 ; _index < _orderIds.length ; _index ++){
            ordersReturn_[_index] = getOrderById(_orderIds[_index]);
        }
        return ordersReturn_;
    }

    function getUserItems (address _user) public view returns(uint256[] memory){
        bytes32 _keyUserOrdersOnSell = keccak256(abi.encode("USER.ORDER.IDS.ONSELL",_user));
        return LibDiamond.getArrayUint(_keyUserOrdersOnSell);
    }

    function getUserOrderIdSoldOut (address _user) public view returns(uint256[] memory){
        bytes32 _keyUserOrdersSoldOut = keccak256(abi.encode("USER.ORDER.IDS.SOLDOUT",_user));
        return LibDiamond.getArrayUint(_keyUserOrdersSoldOut);
    }

    function getUserOrderSoldOut (address _user) public view returns(LibDiamond.SaleOrder[] memory ordersReturn_){
        uint256[] memory _orderIds = getUserOrderIdSoldOut(_user);
        ordersReturn_ = new LibDiamond.SaleOrder[](_orderIds.length);
        for(uint256 _index = 0 ; _index < _orderIds.length ; _index ++){
            ordersReturn_[_index] = getOrderById(_orderIds[_index]);
        }
        return ordersReturn_;
    }

    function getUserOrderIdOnSell (address _user) public view returns(uint256[] memory){
        bytes32 _keyUserOrdersOnSell = keccak256(abi.encode("USER.ORDER.IDS.ONSELL",_user));
        return LibDiamond.getArrayUint(_keyUserOrdersOnSell);
    }
}
